export const JobPerks = Object.freeze({
    MOOD: 'mood',
    CHALLENGE: 'challenge',
    SALARY: 'salary',
    WORK_HOURS: 'work_hours',
    TRAINING: 'training',
    RESPONSABILITIES: 'responsabilities',
    PERKS: 'perks',
    OTHER: 'others'
});
